import Datas from '../datas/data.json'
//je récupère le fichier jSon

function Offers () {
    return(
        <div className='cards_content'>{Datas.map((offers, index) => { //index = keys
            return (
                <div>
                    <h2 className='cards_title'>{offers.title}</h2>
                    <img className= 'cards_img' src={offers.cover} alt={offers.title}></img>
                </div>
                )}
            )}
        </div>
    )
}

export default Offers
